import React from "react";
import Link from "next/link";

const indexPage = () => {
  return (
    <div>
      <h1>This is the main page</h1>
      <p>
        GO TO
        <Link href="/auth">
          <a> Auth</a>
        </Link>
      </p>
    </div>
  );
};

export default indexPage;
